'''
给定一个二进制数组， 计算其中最大连续 1 的个数。
示例：
输入：[1,1,0,1,1,1]
输出：3
解释：开头的两位和最后的三位都是连续 1 ，所以最大连续 1 的个数是 3.

提示：
输入的数组只包含 0 和 1 。
输入数组的长度是正整数，且不超过 10,000。
'''


class Solution:
    def findMaxConsecutiveOnes(self, nums) -> int:
        count_number = 0
        count_list = []
        l = len(nums)
        print(l)
        if l <= 10000:
            for i in range(l + 1):
                if i != l and nums[i] == 1:
                    count_number += 1
                elif i == l or nums[i] == 0:
                    count_list.append(count_number)
                    count_number = 0
            count_list.sort()
            return count_list[-1]

    def findMaxConsecutiveOnes2(self, nums) -> int:
        count_number = 0
        tmp = 0
        l = len(nums)
        print(l)
        if l <= 10000:
            for i in range(l + 1):
                if i != l and nums[i] == 1:
                    count_number += 1
                elif i == l or nums[i] == 0:
                    tmp = max(count_number, tmp)
                    count_number = 0
            return tmp


